"original": |2-
     This REQUIRED Printer attribute MUST have the same cardinality
     (contain the same number of values) as the "printer-uri-supported"
     attribute.  This attribute identifies the security mechanisms used
     for each URI listed in the "printer-uri-supported" attribute.  The
     "i-th" value in "uri-security-supported" corresponds to the "i-th"
     value in "printer-uri-supported", and it describes the security
     mechanisms used for accessing the Printer via that URI.  See
     [RFC8010] for more details on security mechanisms.
"fixed": |-
  This REQUIRED Printer attribute MUST have the same cardinality (contain the same number of values) as the "printer-uri-supported" attribute.  This attribute identifies the security mechanisms used for each URI listed in the "printer-uri-supported" attribute.  The "i-th" value in "uri-security-supported" corresponds to the "i-th" value in "printer-uri-supported", and it describes the security mechanisms used for accessing the Printer via that URI.  See [RFC8010] for more details on security mechanisms.
"ko": |-
  이 필수 프린터 속성은 "printer-uri-supported" 속성과 동일한 카디널리티(동일한 수의 값 포함)를 가져야 합니다. 이 속성은 "printer-uri-supported" 속성에 나열된 각 URI에 사용되는 보안 메커니즘을 식별합니다. "uri-security-supported"의 "i-th" 값은 "printer-uri-supported"의 "i-th" 값에 해당하며 해당 URI를 통해 프린터에 액세스하는 데 사용되는 보안 메커니즘을 설명합니다. 보안 메커니즘에 대한 자세한 내용은 [RFC8010]을 참조하세요.
